import React, { FC, CSSProperties } from "react"
import styles from './index.module.css'; 
//把整个css文件引入过来，当作一个style（相当于dom）        import "./index.css"
{/* JS中的import 代替了HTML中的<link rel="stylesheet" href="styles.css"></link> */}

//因为import './index.css'会导致全局样式的样式冲突问题，为了避免，所以使用module.css
//原理：为每一个css都创建一个随机字符串来保证class的唯一性


//1.在一个element下面，
    // 每一个attribute都占用一个代码块，
    // =左右两边不需要空格，
    // attributes之间不需要逗号

/**2.REACT JS中CSS的写法用两个大括号来写
 * 子的attribute每个占用一行
 * key: value的形式，左边有空格，右边有空格
 * 子的attributes之间用逗号
 */

const Statistics: FC = (): JSX.Element => {
    return (
        //JSX Element里面声明变量必须用一层大括号给包裹起来，对于object，Ts的语法依然是一层大括号，里面的元素用逗号分隔
        <div>
            <table
                className={styles['an-table']}
            >
                <thead>

                </thead>

                <tr className={styles['an-tr']}>
                    <th>Firstname</th>
                    <th>Lastname</th>
                    <th>Age</th>
                </tr>
                <tr>
                    <td  className={styles['an-td']}>Jill</td>
                    <td  className={styles['an-td']}>Smith</td>
                    <td  className={styles['an-td']}>50</td>
                </tr>
                <tr>
                    <td className={styles['an-td']}>Eve</td>
                    <td className={styles['an-td']}>Jackson</td>
                    <td className={styles['an-td']}>94</td>
                </tr>
            </table>
        </div>
    )
}
export default Statistics;
